Step-by-step reasoning:
• The participant’s proposal in percentage (proposed_perc) is assumed to stem from a fairness motive: comparing the participant’s found tokens (token_self) to the opponent’s (token_opp). The idea is that a higher relative contribution by the participant (a positive difference) should lead to a lower percentage offered to the opponent, whereas a lower contribution should result in a higher offer.
• In addition, the experimental manipulation expressed by trial_type (equal contributions, opponent more, or participant more) may systematically bias the proposer’s sense of fairness. Centering trial_type around its “neutral” condition (trial_type = 2, where opponent’s tokens exceed participant’s tokens) allows capturing boundaries of generosity or sting.
• Mathematically, we can capture these ideas using a normalized difference measure d = (token_self – token_opp)/(token_self + token_opp) – this measure is bounded between –1 and +1. A linear combination of an intercept, the fairness differential (with a negative weight to reflect that a higher self contribution reduces generosity), and a trial_type effect (centered so that trial_type 2 does not shift the baseline) will form the core of the model.
• Finally, noise is added to account for variability in decisions with an additive Gaussian error term.
• The learnable parameters are an intercept (theta0), a fairness sensitivity (theta1), a trial_type bias (theta2), and the noise standard deviation (sigma). Their bounds are chosen to be generous but finite. For instance, theta0 is restricted between 0 and 100 (percentage scale), theta1 between 0 and 100 (as it multiplies a ratio bounded between –1 and +1), theta2 between –50 and 50, and sigma is positive and bounded between 0.01 and 20.

